import React from 'react';
import { withStyles } from '@material-ui/core/styles';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemText from '@material-ui/core/ListItemText';
import MenuItem from '@material-ui/core/MenuItem';
import Menu from '@material-ui/core/Menu';
import {arrows_down} from 'react-icons-kit/linea/arrows_down';
import Icon from 'react-icons-kit';


const styles = theme => ({
  root: {
    width: 300,
    maxWidth: 360,
    backgroundColor: theme.palette.background.paper,
  },
});


class SimpleListMenu extends React.Component {
  constructor(props){
    super(props);
    this.state = {
      branchChoice:"master",
      anchorEl: null,
      selectedIndex: 0,
    };
  }

  handleClickListItem  (event)  {
    this.setState({ anchorEl: event.currentTarget });
  };

  handleMenuItemClick  (event, index,branchName)  {
    this.setState({ branchChoice:branchName, anchorEl: null });
  };

  handleClose () {
    this.setState({ anchorEl: null });
  };

  render() {
    const { anchorEl } = this.state;
    return (
      <div className="BranchMenu">
        <List component="nav" className="Button">
          <ListItem
            button
            aria-haspopup="true"
            aria-controls="lock-menu"
            aria-label="branch-select"
            onClick={(e)=>{this.handleClickListItem(e); this.props.getBranches()}}
          >
            <ListItemText
              primary={this.state.branchChoice}
            />
            <Icon icon={arrows_down} size={20}/>
          </ListItem>
        </List>
        <Menu
          id="lock-menu"
          anchorEl={anchorEl}
          open={Boolean(anchorEl)}
          onClose={this.handleClose}
        >
          {!this.props.branches &&
            (<MenuItem onClick={event => this.handleMenuItemClick(event, 0)}>
              {this.props.branchChoice}
            </MenuItem>)
          }
          {this.props.branches && (this.props.branches.sort().map((branch, index) => (
            <MenuItem
              key={index}
              selected={index === this.state.selectedIndex}
              onClick={event => this.handleMenuItemClick(event, index,branch.name)}>
              {branch.name}
            </MenuItem>
          )))}
        </Menu>
      </div>
    );
  }
}


export default withStyles(styles)(SimpleListMenu);
